import styled from "styled-components";

export const Wrapper = styled.div`
    display: flex;
    width: 100%;
    justify-content: space-between;
    padding: 4px;
`;

export const Input = styled.input`
    border: 1px solid #ccc;
    border-radius: 8px;
    width: 100%;
    height: 44px;
    margin-right: 4px;
`;
